import React, { Component } from 'react'
import { Form, Divider, Container, Button, Menu } from 'semantic-ui-react'

class Confirmation extends Component{
    saveAndContinue = (e) => {
        e.preventDefault();
        this.props.nextStep();
    }

    back  = (e) => {
        e.preventDefault();
        this.props.prevStep();
    }

    render() {
        return(
            <Form>
            <Menu fluid vertical borderless widths={5}>
                <Menu.Item>
                </Menu.Item>
                <Menu.Item>
                  Name
                </Menu.Item>
                <Menu.Item>
                  Quantity
                </Menu.Item>
                <Menu.Item>
                  Price
                </Menu.Item>
                <Menu.Item>
                  Action
                </Menu.Item>
            </Menu>
            <Divider hidden />
            <Container>
                <Button fluid color='orange' onClick={this.saveAndContinue}>Proceed</Button>
                <Button fluid onClick={this.back} style={{ marginTop: '0.5em' }}>Back</Button>
            </Container>
            </Form>
        )
    }
}

export default Confirmation
